define({"topics" : [{"title":"Deploying build agent - XAML builds","shortdesc":"\n                           <p class=\"shortdesc\">To use TFBuild, you must have at least one build agent. A         build agent does the processor-intensive work of your build,\n                              which includes getting files         from version control, provisioning the workspace, compiling the code, running tests,\n                              and         merging files back into version control. Each build agent is dedicated to a single build         controller.\n                           </p>\n                        ","id":"task_i3y_wyt_kr","href":"TA_Help\/Topics\/ug_MTM_config_build_agent.html","menu": {"hasChildren":false,},"tocID":"task_i3y_wyt_kr-d46e24477","topics":[]},{"title":"Deploying a Windows build agent - TFBuild","shortdesc":"\n                           <p class=\"shortdesc\">For TFBuild build definitions, to build Visual Studio solutions, you&apos;ll need at least         one Windows build agent. </p>\n                        ","id":"task_x1n_nwj_4v","href":"TA_Help\/Topics\/ug_MTM_deploy_windows_build_agent.html","menu": {"hasChildren":false,},"tocID":"task_x1n_nwj_4v-d46e24488","topics":[]}]});